import React from 'react';
import {render} from 'react-dom';
import App from './components/App';






fetch('https://dog.ceo/api/breeds/list/all')
    .text()
    .then(function(text) {
    console.dir(text); 


    render(<App URL={text}/>, document.getElementById('root'));
    })
